Efficient MongoDB query to split a field into an array<p>This code splits the <code>nicknames</code> field in the <code>cities</code> collection into an array, but it's way to slow:</p>

<pre><code>db.cities
  .find()
  .snapshot()
  .forEach(function(el) {
    el.nicknames = el.nicknames.split('-&gt;')
    db.cities.save(el)
  })
</code></pre>

<p>This code also splits the <code>nicknames</code> field in the <code>cities</code> collection into an array and it's much faster, but it temporarily causes the database size to double which crashes my database.</p>

<pre><code>db.cities.aggregate(
    [
        { "$addFields": { 
            "nicknames": { "$split": [ "$nicknames", "-&gt;" ] } 
        }},
        { "$out": "cities" }
    ]
)
</code></pre>

<p>This seems like a trivial database task.  There has to be a better way... right?</p>

