<p>}</p>; Answer: The binary representation of a number **is** bits.  You asked to get the positions of 1's in binary representation; that's exactly the same as asking where the 1 bits are.  That's why we use bitwise operators.  Also, the method is not "converting" decimal numbers to binary.  `number` is already stored in binary in the computer; the decimal-to-binary conversion took place a long time ago, when the compiler saw the number `5` in your main method and converted it to binary.

